import { useState } from "react";

const Jam = () => {
    let time = new Date().toLocaleTimeString;
    const [currentTime, setCurrentTime] = useState(time);

    const updateTime = () => {
        let time = new Date().toLocaleTimeString;
        setCurrentTime(time);
    };
    setInterval(updateTime, 1000);
    return (
        <>
            <h2>{currentTime}</h2>
        </>
    );
};
export default Jam;
